import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

// Option 1: Remove React.StrictMode to avoid duplicate mounting effects.
// This may completely remove the error if StrictMode is causing it.
const root = ReactDOM.createRoot(document.getElementById('root'));

// Option 2: Monkey-patch ResizeObserver to swallow errors.
if (window.ResizeObserver) {
  const OriginalResizeObserver = window.ResizeObserver;
  window.ResizeObserver = class extends OriginalResizeObserver {
    constructor(callback) {
      const patchedCallback = (entries, observer) => {
        try {
          callback(entries, observer);
        } catch (e) {
          // Suppress the error
        }
      };
      super(patchedCallback);
    }
  };
}

// Render without StrictMode
root.render(<App />);
